import supportedBus from '../images/supported/bus.png';
import supportedMinivan from '../images/supported/minivan.png';
import supportedManhole from '../images/supported/manhole.png';
import supportedMountainBike from '../images/supported/mountainBike.png';
import supportedParkBench from '../images/supported/parkBench.png';
import supportedPoliceCar from '../images/supported/policeCar.png';
import supportedRV from '../images/supported/rv.png';
import supportedStreetSign from '../images/supported/streetSign.png';
import supportedTaxi from '../images/supported/taxi.png';
import supportedTrafficLight from '../images/supported/trafficLight.png';

import preset1 from '../images/presets/preset1.jpg';

import { useState } from 'react';

import Page from './Page';
import UploadButton from '../components/UploadButton';

const DemoPage = () => {

    const [error, setError] = useState("");
    const [uploadImage, setUploadImage] = useState(null);
    const [resultImage, setResultImage] = useState(null);
    const [resultData, setResultData] = useState(null);

    const startAnalyzing = (image) => {
        setUploadImage(image);
        setError(null);

        // axios.post("http://localhost:5000/imagenet", {image: image}).then((response) => {
        //     setResult(response.data);
        // }).catch((err => {
        //     console.log(err);
        // }));
    }

    const PreUpload = () => {

        const CheckMarkListItem = ({text}) => {
            return <div className="flex my-3">
                <div className="pl-6">
                    <p className="text-slate-700">
                        <i className="fa-solid fa-check"></i>
                    </p>
                </div>
                <div className="pl-2">
                    <p className="text-slate-700">
                        {text}
                    </p>
                </div>
            </div>
        }

        const SupportedObjects = () => {
            const types = [
                {name: "R.V.", image: supportedRV},
                {name: "Street sign", image: supportedStreetSign},
                {name: "School bus", image: supportedBus},
                {name: "Mountain bike", image: supportedMountainBike},
                {name: "Taxi", image: supportedTaxi},
                {name: "Minivan", image: supportedMinivan},
                {name: "Traffic light", image: supportedTrafficLight},
                {name: "Park bench", image: supportedParkBench},
                {name: "Police car", image: supportedPoliceCar},
                {name: "Manhole cover", image: supportedManhole},
            ];

            return (
                <div className="w-full rounded-lg px-5 py-4 bg-slate-100">
                    <h3 className="text-slate-400 font-bold tracking-wider">
                        <i className="fa-solid fa-info-circle mr-2"></i>SUPPORTED OBJECT CLASSES
                    </h3>
                    <div className="flex mt-3 flex-wrap">
                        {types.map((t, index) =>
                            <div className={"px-2 py-2 w-6/12 odd:border-r-2 odd:border-r-slate-200 flex items-center " + (index < types.length - 2 ? "border-b-2 border-b-slate-200" : "")}>
                                <div className="w-12">
                                    <img src={t.image} className="w-full" />
                                </div>
                                <p className="text-slate-600 pl-3">
                                    {t.name}
                                </p>
                            </div>    
                        )}
                    </div>
                </div>
            );
        }

        const Presets = () => {
            const presets = [
                preset1,
                preset1,
                preset1,
                preset1,
                preset1,
                preset1,
                preset1,
                preset1,
                preset1,
            ];

            return (
                <div className="w-1000 mx-auto mt-12 grid grid-cols-3 gap-x-12 gap-y-8 mb-24">
                    {presets.map(preset =>
                        <div className="h-52 relative">
                            <div className="rounded-lg w-full h-full opacity-0 hover:opacity-100 bg-mac-maroon bg-opacity-60 hover:cursor-pointer absolute left-0 flex flex-col place-content-center">
                                <h1 className="text-white font-bold text-center">Choose This Image</h1>
                            </div>
                            <img src={preset} onClick={(e) => startAnalyzing(getBase64Image(e.target))} className="object-cover rounded-lg w-full h-full" />
                        </div>    
                    )}
                </div>
            );
        }

        const getBase64Image = (img) => {
            var canvas = document.createElement("canvas");
            canvas.width = img.naturalWidth;
            canvas.height = img.naturalHeight;
            var ctx = canvas.getContext("2d");
            ctx.drawImage(img, 0, 0);
            var dataURL = canvas.toDataURL("image/png");
            return dataURL;
        }

        return (
            <>
                <div className="bg-white w-1000 mx-auto rounded-lg shadow-lg py-8 px-8 flex gap-8">
                    <div className="w-6/12">
                        <h1 className="text-mac-maroon text-2xl font-bold tracking-wider">UPLOAD AN INPUT IMAGE</h1>
                        <p className="text-slate-700 mt-6 mb-6">Choose an input file that meets the following criteria:</p>
                        <CheckMarkListItem text="A PNG, JPG, or GIF image" />
                        <CheckMarkListItem text="No larger than 5MB" />
                        <CheckMarkListItem text="Contains less than 5 instances of supported objects" />
                        <div className="mt-8">
                            <UploadButton text="CHOOSE FILE" icon="fa-circle-chevron-right" iconSide="right" /> 
                        </div>
                        <p className="text-red-600 mt-6">{error}</p>
                    </div>
                    <div className="w-6/12">
                        <SupportedObjects />
                    </div>
                </div>
                <h1 className="relative z-10 tracking-wide text-slate-700 text-center text-2xl lg:text-3xl font-bold lg:mt-16">OR TRY OUR PRESETS</h1>
                <Presets />
            </>
        )
    }

    return (
        <Page>
            {uploadImage === null ? <PreUpload /> : null}
        </Page>
    );
}

export default DemoPage;
